import '../styles/App.css';
import SearchBar from './SearchBar';
import Playlist from './Playlist';
import SearchResults from './SearchResults';
import { useState } from 'react';

function App() {
  const [playlist, setPlaylist] = useState([
    { name: "bad ones", artists: ["Tate Mcrae"], album: "Too Young to Be Sad" },
  ]);

  return (
    <div className="all">
      <div className="App">
        <header className="App-header">
          <h1>Ja<span className="purple">mmm</span>ing</h1>
        </header>
      </div>
      <SearchBar />
      <div className='flex'>
        <SearchResults />
        <Playlist playlist={playlist} />
      </div>
      <p>Jeg vil gerne have en knap, hvor man kan se mine mest lyttede sange+kunstnere i hver måned(5)+år(10)</p>
    </div>
  );
}

export default App;
